import React from 'react';
import { BrowserRouter as Router, Switch, Route , Link} from 'react-router-dom';
import routes from './_store/routers';


class App extends React.Component {
  render(){
    return (
      <routes></routes>
    );
  }
}
function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}
export default App;
